import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Information from '../Information';
import Input from '../Input';
import Footer from '../Footer';

function Home() {
  return (
    <div className='outer'>
      <HeroSection />
      <Information />
      <Input />
      <Footer />
    </div>
  );
}

export default Home;
